import { StyleSheet} from 'react-native';
const userComponentStyles = StyleSheet.create({
  div:{
    backgroundColor: '#fff',
    padding:10,
    margin:10,
    borderRadius:5,
    paddingRight:20,
    opacity:0.5
  },
  text:{
    color:'#1e2833',
    paddingLeft:10
  },
  nevek:{
    color:'#1e2833',
    fontWeight: "bold"
  },
  icons:{
    fontSize:15,
    color:'#1e2833',
  }
});
export {userComponentStyles};
